'use strict';
module.exports = function(sequelize, DataTypes) {
  var Recruitergroup = sequelize.define('Recruitergroup', {
    recruitergroup_name: DataTypes.STRING
  }, {
    classMethods: {
      associate: function(models) {
      Recruitergroup.hasMany(models.Recruiter);
      }
    }
  });
  return Recruitergroup;
};